import flag1 from "../../src";
import flag2 from "../../Resources/images/2flag-fr.svg";
import flag3 from "../../Resources/images/3flag-za.svg";
import flag4 from "../../Resources/images/4flag-lr.svg";
import flag5 from "../../Resources/images/5flag-gh.svg";
import flag6 from "../../Resources/images/6flag-td.svg";
import flag7 from "../../Resources/images/7flag-gb.svg";
import CompNewsletter from "../DocComponent/CompNewsletter";
import CompNavbar from "../DocComponent/CompNavbar";
import CompFooter from "../DocComponent/CompFooter";
import styled from "styled-components";
import sec1bg from "../../Resources/images/sec1bg3.png";
import CompPlatforms from "../DocComponent/CompPlatforms";
import { useNavigate } from "react-router-dom";
import Typewriter from "typewriter-effect";

const sec1pic = new URL("../../Resources/images/sec1pic.png", import.meta.url);
const sec3pic = new URL("../../Resources/images/sec3pic.png", import.meta.url);
const sec5pic = new URL("../../Resources/images/sec5pic.png", import.meta.url);
const sec6pic = new URL("../../Resources/images/sec6pic.png", import.meta.url);
const sec7pic = new URL("../../Resources/images/sec7pic.png", import.meta.url);

function play() {
  <iframe
    width="420"
    height="345"
    src="https://www.youtube.com/embed/tgbNymZ7vqY?controls=0"
  ></iframe>;
  console.log("You clicked me");
}

const DocHomepage = () => {
  const Homecontainer = styled.div`
    background-color: #fff;
    .container1 {
      background-image: url(${sec1bg});
      background-size: cover;
      background-position: center;
      height: 90vh;
      width: 100%;
      display: flex;
      justify-content: space-between;
      margin-bottom: 30px;

      .sec1 {
        margin-top: 50px;
        margin-left: 35px;

        .minsec {
          width: 500px;
          h4 {
            margin-top: 40px;
            font-size: 40px;
            font-weight: bold;
            color: #00111b;

            span {
              
            }
          }

          p {
            margin-top: 30px;
            font-size: 15px;
            color: #64607d;
          }
        }
      }

      .sec2 img {
        margin-top: 30px;
        height: 600px;
        width: 615px;
      }

      #sell {
        margin-top: 30px;
        background: #32cd32;
        padding: 16px 30px;
        border-radius: 4px;
        border: none;
        font-weight: bold;
        color: aliceblue;
        cursor: pointer;
      }

      .fa-play {
        color: white;
        background: red;
        border-radius: 100%;
        margin-left: 25px;
        padding: 16px 19px;
        font-size: 20px;
        text-align: center;
        cursor: pointer;
      }

      .inner {
        display: flex;
        align-items: center;
        align-content: center;
      }

      #playlink {
        margin-left: 5px;
        font-family: "Manrope";
        font-size: 14px;
        font-weight: 600;
        color: rgb(5, 5, 50);
        cursor: pointer;
      }
    }

    .container3,
    .container5,
    .container7 {
      background-image: url("./images/secbg2.png");
      background-size: cover;
      background-position: center;
      height: 80vh;
      width: 100%;
      display: flex;
      justify-content: space-between;
    }

    #container2 {
      margin-right: auto;
      margin-bottom: 55px;
      text-align: center;
    }

    .container3 {
      justify-content: center;
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 10px;
      margin-bottom: 70px;

      img {
        height: 350px;
        width: 470px;
        margin-left: 45px;
      }
    }

    .card3 {
      margin-top: 80px;
      margin-bottom: 50px;
    }

    .card3 h1,
    h4,
    p,
    button {
      margin-top: 20px;
    }

    .card3 h4 {
      margin-top: 0;
    }

    .card3 h4 i {
      font-size: 13px;
      color: #32cd32;
      margin-left: 10px;
    }

    .card3b {
      display: flex;
      flex-direction: column;
      justify-content: center;

      h1 {
        font-size: 24px;
      }
    }

    .card3 p {
      font-size: 15px;
      color: #64607d;
    }

    .card3 button {
      margin-top: 30px;
      background: #32cd32;
      width: fit-content;
      padding: 16px 30px;
      border-radius: 7px;
      border: none;
      font-weight: bold;
      color: aliceblue;

      i {
        margin-left: 10px;
      }
    }

    .container4 {
      color: aliceblue;
      background-color: #1b1c31;
      margin: 0px 35px;
      border-radius: 10px;
      margin-bottom: 70px;
      padding-bottom: 60px;
    }

    #cont4header {
      padding-top: 55px;
      font-weight: bold;
      font-size: 40px;
      color: aliceblue;
      text-align: center;
    }

    #cont4para {
      padding-bottom: 45px;
      color: aliceblue;
      text-align: center;
    }

    .card_container {
      color: aliceblue;
      background-color: #1b1c31;
      display: grid;
      grid-template-columns: 1fr 1fr 1fr;
      gap: 20px;
      margin: 10px 35px;
    }

    .card4 h4 {
      color: black;
      text-align: center;
    }

    .card4 {
      padding: 35px 40px;
      background-color: #efefef;
      color: black;
      border-radius: 10px;
      font-size: 14px;
      color: #64607d;
    }

    .card4 i {
      padding: 21px 20px;
      border-radius: 50%;
      background-color: #98ff87;
      margin-right: 10px;
      font-size: 20px;
    }

    .container5 {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 30px;
      margin-bottom: 110px;
    }

    .container5 img {
      margin-top: 55px;
      height: 500px;
      width: 640px;
    }

    .card5 {
      margin-top: 10px;
    }

    .card5 h4 {
      font-size: 25px;
      padding-bottom: 10px;
    }

    .card5a {
      margin-left: 40px;
    }

    .card5 p {
      font-size: 15px;
      padding: 10px;
      height: fit-content;
      background-color: #00111b;
      border-radius: 50%;
      width: fit-content;
      color: #32cd32;
      text-align: start;
    }

    #card5start i {
      color: aliceblue;
      margin-left: 10px;
    }

    #card5start {
      background-color: #32cd32;
      padding: 13px 30px;
      border-radius: 5px;
      font-size: 15px;
      width: fit-content;
      color: aliceblue;
      text-align: start;
    }

    .card5a ol {
      padding: 15px 10;
      margin-bottom: 50px;
    }

    .it1,
    .it2,
    .it3 {
      display: flex;
      margin-top: 20px;
    }

    .card5a ol li {
      padding: 15px 0;
      margin-left: 35px;
      align-items: justify;
      font-size: 14px;
      list-style: none;
    }

    .card5 button {
      margin-top: 20px;
      background: #32cd32;
      padding: 13px 25px;
      border-radius: 7px;
      border: none;
      font-weight: bold;
      color: aliceblue;
    }

    .container6 {
      padding: 0 25px;
      background-color: #00111b;
      margin-top: 30px;
    }

    .container6 {
      justify-content: center;
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 30px;
    }

    .card6 {
      padding: 20px 0;
    }

    .container6 img {
      height: 500px;
      width: 670px;
    }

    .card6 h1 {
      color: aliceblue;
    }

    .card6 h3,
    h5 {
      color: aliceblue;
    }

    .card6 h3 {
      margin-top: 90px;
    }

    .card6 h1 {
      font-size: 40px;
    }

    .card6 p {
      margin-top: 30px;
      font-size: 17px;
      color: aliceblue;
    }

    .card6 button {
      margin-top: 20px;
      background: #32cd32;
      padding: 16px 30px;
      border-radius: 7px;
      border: none;
      font-weight: bold;
      color: aliceblue;
    }

    .card6 button i {
      margin-left: 10px;
    }

    .container7 {
      justify-content: center;
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 30px;
    }

    .container7 img {
      height: 238;
      width: 490px;
      margin-left: 45px;
    }

